import React, { useState, useEffect } from "react";
import {
  Typography,
  Grid,
  Card,
  CardContent,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  List,
  ListItem,
  ListItemText,
  Box,
  CardMedia,
  CardHeader,
  CircularProgress, // Import CircularProgress for the loader
} from "@mui/material";

import ListItemAvatar from "@mui/material/ListItemAvatar";
import Avatar from "@mui/material/Avatar";
import useGoogleBooks from "../useGoogleBooks";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    padding: theme.spacing(2),
  },
  selectFormControl: {
    width: "300px", // Customize the width as needed
  },
}));

const BookList = () => {
  const classes = useStyles();
  const [loading, setLoading] = useState(true); // Add loading state
  const bookData = useGoogleBooks();
  const [selectedAuthor, setSelectedAuthor] = useState("");
  const [filteredBooks, setFilteredBooks] = useState([]);
  console.log("Koca: filteredBooks ", filteredBooks);

  useEffect(() => {
    if (bookData) {
      setLoading(false); // Set loading to false once data is available
    }
  }, [bookData]);

  const authorNames =
    bookData &&
    Array.isArray(bookData) &&
    bookData.map(
      (book) =>
        book.volumeInfo && book.volumeInfo.authors && book.volumeInfo.authors[0]
    );

  const handleAuthorChange = (event) => {
    const author = event.target.value;
    setSelectedAuthor(author);
    const filteredBooks = bookData.filter(
      (book) =>
        book.volumeInfo &&
        book.volumeInfo.authors &&
        book.volumeInfo.authors[0] === author
    );
    setFilteredBooks(filteredBooks);
  };

  return (
    <>
      {loading ? ( // Conditionally render the loader while data is loading
        <CircularProgress />
      ) : (
        <Box style={{ marginRight: "20px", padding: "20px" }}>
          <Grid container>
            <Grid item xs={3} paddingTop={3}>
              <FormControl
                variant="outlined"
                style={{ marginBottom: "20px", maxWidth: "300px" }}
                className={classes.selectFormControl} // Apply the custom CSS class
                size="medium"
              >
                <InputLabel>Select Author</InputLabel>
                <Select
                  size="large"
                  value={selectedAuthor}
                  onChange={handleAuthorChange}
                  label="Select Author"
                >
                  <MenuItem value="">
                    <em>All Authors</em>
                  </MenuItem>
                  {authorNames.map((author, index) => (
                    <MenuItem key={index} value={author}>
                      {author}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
            </Grid>

            <Grid item xs={9}>
              <List>
                {filteredBooks.length > 0 ? (
                  filteredBooks.map((book) => (
                    <ListItem
                      style={{
                        border: "1px solid #ccc",
                        margin: "5px",
                        padding: "10px",
                      }}
                    >
                      <ListItemAvatar>
                        <Avatar
                          alt={book.volumeInfo.title}
                          src={
                            book.volumeInfo &&
                            book.volumeInfo.imageLinks.smallThumbnail
                          }
                        />
                      </ListItemAvatar>
                      <ListItemText
                        primary={book.volumeInfo.title}
                        secondary={
                          <React.Fragment>
                            <Typography
                              sx={{ display: "inline" }}
                              component="span"
                              variant="body2"
                              color="text.primary"
                            >
                              {book.volumeInfo.authors[0]}
                            </Typography>{" "}
                            {book.volumeInfo.subtitle}
                          </React.Fragment>
                        }
                      />
                    </ListItem>
                  ))
                ) : (
                  <p>No books found for the selected author.</p>
                )}
              </List>
            </Grid>
          </Grid>
        </Box>
      )}
    </>
  );
};

export default BookList;
